import React from "react";
import "./Hero.css";

const Hero = () => {
  return (
    <div className="hero-container">
      <div className="hero-content">
        <h1>Welcome to BuyBlink</h1>
        <p>Your one stop shop for best products</p>
        <button className="hero-btn">Shop Now</button>
      </div>
    </div>
  );
};

export default Hero;
